postcontent:
Hard to find Ruger Redhawk, 5 1/2" barrel, Blued 44 Magnum Revolver.

This pistol is in great shape; 
- the trigger has been smoothed; 
- some wear shows on the grip strap; 
- normal "cylinder ring" from cycling. 
- Other than these mentioned, the bluing is beautiful.

Have only fired 12 shots while I've had it, and it shows little evidence of being shot much in the past. Appears to be manufactured in early 80's. Comes with standard rosewood grips, and smaller Hogue finger groove grips as shown in the pictures, as well as original box and manual, etc..

NOTE: I'm not driving far from Norman, and I'm not budging on the price. I'm a longtime Ruger fan, and this pistol's worth every penny.
